ерий. Но к лету снова вернулось к своему обычному состоянию. Озеро довольно глубокое, макс глубина 35м, и тем не менее, у него кристально чистые воды. Здесь водятся просто огроменные рыбы, сомы, карпы и др. Вдоль берега расположено множество отелей на любой вкус и кошелек и туристов тут всегда больше, чем местных. И тем не менее, тут тихий и комфортный отдых, без суеты и громких тусовок. Блед обязательно стоит посетить и лучше остановиться на пару-тройку дней, чтобы все рассмотреть и насладиться красотой. Тем более, всего в 30 км находится озеро Бохинь, Триглавский национальный парк, горнолыжные курорты, водопады и куча других интересностей. Повторюсь еще раз: мы открыли для себя Словению, здесь очень красивая природа, приветливые люди и все очень душевно. Сюда стоит ехать!👍
